import logo from './logo.svg';
import './App.css';
import { Project } from './components/Project.js';

function App() {
  return (
    <div className="App">
      <div className="principal-container">
        <h1>Projects List:</h1>
        <Project 
          project="Ahorcado"
          language="PHP"
          time="1"
          description="Basicamente este es un proyecto muy pero que muy simple en el que se crea un Ahorcado en PHP. EL tipico juego. Pero hecho con programacion orientada a objetos"
          image=""/>
      </div>
    </div>
  );
}

export default App;
